import React from "react";
import { Link } from "react-router-dom";
export default function Header() {
  return (
    <ul>
      <li>
        <Link to="/">Home</Link>
        <Link to="button">Button</Link>
        <Link to="banner">Banner</Link>
        <Link to="installation">installation</Link>
      </li>
    </ul>
  );
}
